import React from 'react';
import './App.css';

function Tile({ x, y }) {
  const tileStyle = {
    left: `${(x - y) * 50}px`,
    top: `${(x + y) * 25}px`
  };

  return (
    <div className="tile" style={tileStyle}>
      <div className="tile__top"></div>
      <div className="tile__side"></div>
    </div>
  );
}

function App() {
  const tiles = [];
  for (let i = 0; i < 10; i++) {
    for (let j = 0; j < 10; j++) {
      tiles.push(<Tile x={i} y={j} key={`${i}-${j}`} />);
    }
  }

  return (
    <div className="App">
      {tiles}
    </div>
  );
}

export default App;
